import { render } from '@testing-library/react'
import Nav from '../nav/nav'
import React from 'react'
import Context from '../Context'

class Cart extends React.Component {
  render() {
    const { cartList } = this.context
    return (
      <div>
        <Nav />
        <div>
          <div>
            <h2>Cart</h2>
          </div>
          <ul>
            {cartList.map((item) => {
              ;<li>{item.id}</li>
            })}
          </ul>
        </div>
      </div>
    )
  }
}

Cart.contextType = Context

export default Cart
